import React from "react";
import { VideoButton } from "arclight-react";

export default function VButton(props) {
  return (
    <div>
      <VideoButton
        style={"a"}
        data={{
          src: props.src,
          type: "video/mp4"
        }}
      />
      <div
        className="GoldBkg"
        style={{
          height: "80px",
          position: "absolute",
          top: "0",
          width: "100%"
        }}
      >
        <div className="BlockTitle">
          <i className="fas fa-user-plus" style={{ paddingRight: "5px" }}></i>
          New Members
        </div>
        <div className="BlockText">
          New to TES? Click here to get a valet tour of what we offer.
        </div>
      </div>
    </div>
  );
}
